import React from 'react';
import {connect} from 'react-redux';
import {withRouter} from 'react-router-dom';
import {openPopup, closePopup} from '../store/modal/actions';
import {addNotify} from '../store/notify/actions';
import {
  getUserProjects, 
  createUserProject, 
  deleteUserProject, 
  addUserInProject,
  deleteUserInProject,
  getOtherProjects,
} from '../store/projects/actions';
import Home from '../components/Home/Home';


function HomeContainer(props) {
  return (
    <Home 
      history={props.history}
      popupIsOpen={props.popupIsOpen}
      openPopup={props.openPopup}
      addNotify={props.addNotify}
      closePopup={props.closePopup}
      getUserProjects={props.getUserProjects}
      getOtherProjects={props.getOtherProjects}
      deleteUserProject={props.deleteUserProject}
      deleteUserInProject={props.deleteUserInProject}
      createUserProject={props.createUserProject}
      createUserInProject={props.createUserInProject}
      addUserInProject={props.addUserInProject}
      myProjects={props.myProjects}
      auth={props.auth}

    />
  );
}

const mapStateToProps = (state) => {
  return {
    popupIsOpen: state.modal.popupIsOpen,
    myProjects: state.projects.myProjects,
    getOtherProjects: state.projects.otherProjects,
    auth: state.auth,
  }
};

const mapDispatchToProps = {
  openPopup,
  closePopup,
  getUserProjects,
  createUserProject,
  addNotify, 
  deleteUserProject,
  addUserInProject,
  deleteUserInProject,
  getOtherProjects
};

const HomeContainerWidthRouter = withRouter(HomeContainer);

export default connect(mapStateToProps, mapDispatchToProps)(HomeContainerWidthRouter);
